import React from 'react'
import styled from 'styled-components'




export default function Support() {
  const supportDiv = styled.div`
width:100%;
min-height:300px;
background-color:red;
`;
  return (
    <supportDiv>

        This is where the support goes
    </supportDiv>
  )
}
